import React, { useState } from 'react';
import { Container, Row, Col, Form, Button } from 'react-bootstrap';
import * as Diary from '../Diary';
import { BsPencil, BsChevronUp, BsChevronDown, BsClock } from 'react-icons/bs';
import { FaPaperPlane } from 'react-icons/fa';
import { VscSmiley } from 'react-icons/vsc';
import { HiOutlineDotsHorizontal } from 'react-icons/hi';

const toolSize = 25;

const tools = [
    {
        icon: <FaPaperPlane size={toolSize} />,
    }
]

const ToolBar = (props) => {

    return (
        <Row>
            {tools.map((tool, index) => {
                return (
                    <Col key={`tool-${index}`} xs={2} >
                        <div className="card text-primary d-flex justify-content-center align-items-center">
                            {tool.icon}
                        </div>
                    </Col>
                )
            })}
        </Row>
    )
}

export default ToolBar;
